import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import {Provide} from 'react';

ReactDOM.render(
  <React.StrictMode>
    <Provide></Provide>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
